const Home = ({date}) => {
    console.log(date)
    return (
    <div>{date.name}</div>
    )
}

export async function getStaticProps(context) {
    const res = await fetch("http://localhost:3000/api/api");
    const json = await res.json();
    return {
      props: {
        data: json,
      },
    };
  }

export default Home
